          calculate: floor(datum.t_first_value_pos / 1000000)
          as: starting_millisecond
        }

        {
          "calculate": "'Events since '  + utcFormat(datum.starting_millisecond,'%B %d, %Y  - %H:%M:%S.%L (UTC)')",
          "as": "abcd"
        }

        {
          "calculate": datum.t_first_value_pos - datum.t_first_value_pos
          as: testX
        }

        {
          calculate: datum._source.return_timestamp - datum._source.call_timestamp
          as: exec_time
